import React, { useState, useEffect } from "react";
import {
    StyleSheet,
    Platform,
    TouchableWithoutFeedback,
    Keyboard,
    View,
    Image,
} from "react-native";
import { HomeTopIcon, Page, TitleHome } from "../styles";
import { Text, TextInput, Button } from "react-native-paper";

const iconImage = require("../../assets/download_images.png");

const Home = ({ route, navigation }) => {
    const [imageUrl, setImageUrl] = useState("");

    return (
        <Page behavior={Platform.Os == "ios" ? "padding" : "height"}>
            <TouchableWithoutFeedback onPress={Keyboard.dismiss}>
                <View
                    style={{
                        flex: 1,
                        padding: 20,
                    }}
                >
                    <HomeTopIcon>
                        <Image
                            style={{ width: 200, height: 200 }}
                            source={iconImage}
                        />
                    </HomeTopIcon>
                    <TitleHome>Inspicdown</TitleHome>
                    <Text style={styles.textCenter}>
                        Insira o link da imagem do instagram abaixo
                    </Text>
                    <TextInput
                        style={{ marginTop: 20 }}
                        label="Seu link aqui"
                        mode="outlined"
                        onChangeText={(text) => setImageUrl(text)}
                    />
                    <Button
                        style={{ marginTop: 20, alignSelf: "center" }}
                        mode="contained"
                        onPress={() =>
                            navigation.navigate("downloadScreen", {
                                url: imageUrl,
                            })
                        }
                    >
                        Carregar
                    </Button>
                </View>
            </TouchableWithoutFeedback>
        </Page>
    );
};

export default Home;

const styles = StyleSheet.create({
    textCenter: {
        textAlign: "center",
    },
});
